import React from 'react'
import Navbar from '../components/navbar';
import WazuhAgents from '../components/wazuh_agents';
import './Home.css';
import WazuhCombined from '../components/wazuh_combined';
// import SearchBar from '../components/searchbar';

// import WazuhActive from '../components/wazuh_active';
// import WazuhInactive from '../components/wazuh_inactive';

function Home() {
  return (
      <div className='container-fluid'>
        <div className="row">
          <div className="col-2" style={{height:"500px"}}>
            <Navbar />
          </div>
        
        
        <div className='col-8'>
        <WazuhAgents/>
        
        <h3 className='text-center'>Overview</h3>
        {/* <SearchBar /> */}
          <div className="container">
          
            <WazuhCombined/>
          
          </div>
          </div>
       
        </div>
        </div>
  )
}

export default Home
